// Import image
import live_camera_icon from "../icons/live_camera.png";
import camera_trap_icon from "../icons/camera_trap.png";
import noise_sensor_icon from "../icons/microphone.png";
import unique_public_source_icon from "../icons/unique_public_source.png";

const SENSORS = [
    {"type": "camera_trap", "latitude":51.5094, "longitude":-2.5890, "id": 1, "icon": camera_trap_icon},
    {"type": "live_camera","latitude":51.5100,"longitude":-2.5957, "id": 2, "icon": live_camera_icon},
    {"type": "noise_sensor", "latitude":51.5085, "longitude":-2.5950, "id": 1, "icon": noise_sensor_icon},
    {"type": "unique_public_source","latitude":51.5080,"longitude":-2.5925, "id": 1, "icon": unique_public_source_icon}
];

export default SENSORS;
